import React from 'react'
import Note from './Note'

const NoteList = ({notes, toggleComplete}) => {
  return (
    <ul>
      {notes.map( note => (
        <Note key={note.id} note={note} toggleComplete={toggleComplete}/>
      ))}
    </ul>
  )
}

export default NoteList
